import React from 'react';
import './SearchBar.css';
import location_icon from '../icons/location-icons/location_icon_braun.svg';

function SearchBar() {

    return (

        <div className="input__component--wrapper">
            <div className="input__wrapper">
            <label className="label__title">Your current location</label>
            <input type="text" placeholder="type in your current position" className="input__field"></input>
            </div>
            <div className="input__icon--wrapper">
            <img src={location_icon} className="input__icon" alt="input__icon" />
            </div>
            </div>
    )
}

export default SearchBar;
